function UnableService() {
  return (
    <div className="text-center w-full">
      <img src="/images/connect.png" alt="" className="max-w-md mx-auto w-full" />
      <p className="text-center text-lg">
        To perform this service, Please <strong className="text-pink-400">connect</strong> with your
        wallet
      </p>
    </div>
  );
}

export default UnableService;
